import React from "react";
import logo from "./logo.svg";
import "./App.css";

/* import Header from './Header.js'; */

const App = () => {
  return (
    <div className="app-wrapper">
      <header>
        <img src="https://i.pinimg.com/originals/b9/05/3d/b9053d873e9f69058997913e0fffca2e.png"></img>
      </header>
      <nav>
        <div>Profelis</div>
        <div>Message</div>
      </nav>
      <div>Main content</div>
    </div>
  );
};

export default App;
